import React from "react";
import { FooterLinks, Icons } from "./Constants";
import {
  FooterBlock,
  FooterContent,
  FooterListWrapper,
  NameLi,
  Li,
  FooterIcon
} from "./FooterFragments";

const FooterLinkComponent = props =>
  props.links.map(
    (item, index) =>
      props.lowerFooter && (
        <FooterListWrapper key={index}>
          <ul className="text-left align-top">
            <NameLi> {item.name} </NameLi>
            {item.links.map((link, index) => (
              <Li key={index}>
                {props.icon ? (
                  <FooterLink href={link.href}>{link.name}</FooterLink>
                ) : (
                  <FooterIcon
                    country={item.country}
                    inactive={link.inactive}
                    href={link.href}
                    url={link.url}
                  />
                )}
              </Li>
            ))}
          </ul>
        </FooterListWrapper>
      )
  );

const FooterComponent = props => (
  <FooterBlock>
    <FooterContent>
      <FooterLinkComponent
        links={FooterLinks}
        lowerFooter={props.lowerFooter}
        icon={false}
      />
      <FooterLinkComponent
        links={Icons}
        lowerFooter={props.lowerFooter}
        icon={true}
      />
    </FooterContent>
  </FooterBlock>
);

export default FooterComponent;
